import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import SearchResults from "./pages/SearchResults";
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path={["/", "/books"]}>
            <SearchResults />
          </Route>
          {/* <Route exact path="/events/:id">
          </Route> */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
